import React from "react";
import { Bar } from "react-chartjs-2";

function Chart() {
  return (
    <div>
      <Bar
        data={{
          labels: ["Ponedeljak", "Utorak", "Sreda"],
          datasets: {
            label: "# of votes",
            data: [12, 19, 3, 5, 2, 3],
            backgroundColor: ["rgba(255,99,132,0.2"],
          },
        }}
        height={200}
        width={300}
        options={{
          maintainAspectRatio: false,
        }}
      />
    </div>
  );
}

export default Chart;
